import image1 from "../assets/images/image_mel.png";

export default function MeloVibePage() {
  return (
    <>
      <div className="pl-10">
        {/* Title */}
        <div className="text-primary-color ">MeloVibes</div>

        {/* Body */}

        <div className="flex justify-between h-screen items-center">
          <div className="text-primary-text-color flex flex-col">
            {/* Header */}
            <span className="text-6xl"></span>
            <span className="font-bold text-6xl">the vibe</span>

            {/* Paragraph */}
            <p>
              Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nunc ac
              felis sed massa porta malesuada. In placerat tempor metus at
              ultrices. Duis dapibus odio non faucibus rutrum. Mauris in nibh
              imperdiet nunc ultrices facilisis. Vivamus sit amet nibh sed purus
              accumsan interdum vitae vel nisi. Phasellus sed varius purus.
            </p>

            {/* Button to go to the mood page */}
          </div>

          {/* Image and circle */}
          <div className="flex">
            <div className="bg-primary-color border w-150 h-150 mr-auto rounded-full">
              <img
                src={image1}
                alt="landingPage"
                className="w-100 h-150 rounded-bl-full rounded-br-full"
              />
            </div>
          </div>
        </div>
      </div>
    </>
  );
}
